script: |
  super -f tsv -I q6875.sql | sort > q6875.out

vector: true

inputs:
  - name: q6875.sql
    data: |
      SELECT DISTINCT col1 + + col1 AS col1 FROM tab1 cor0 WHERE col1 * + col2 + col1 NOT BETWEEN + col0 + col1 * CAST ( - ( - col1 ) AS INTEGER ) AND 46 + col1;
  - name: tab1

outputs:
  - name: q6875.out
    data: |
      10
      28
      94
